import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap/Container'

class AboutMe extends Component {
  render() {

    return (
		<section id="aboutMe">
			<Container fluid>
			  <Row>
			    <Col>1 of 1</Col>
			  </Row>
			</Container>
		</section>
    );
  }
}

export default AboutMe;
